import React from 'react';
import './App.css';
import CalculatorDisplay from './components/DisplayComponents/CalculatorDisplay';
import NumberButton from './components/ButtonComponents/NumberButton';
import OperatorButton from './components/ButtonComponents/OperatorButton';
import ClearButton from './components/ButtonComponents/ClearButton';
import ZeroButton from './components/ButtonComponents/ZeroButton';

const numbers = [9, 8, 7, 6, 5, 4, 1, 2, 3];
const operators = ['/', 'x', '-', '+', '='];

const App = () => {
  return (
    <div className="App container mt-4">
      <h3>Welcome to React Calculator</h3>

      <div className="row">
        <ClearButton />
      </div>

      <div className="row">
        {numbers.map(numberFromMap => (
          <NumberButton number={numberFromMap} key={numberFromMap} />
        ))}
      </div>

      .

      <div className="row">
        <ZeroButton />
      </div>
    </div>
  );
};

export default App;
